  false,\n\t\"url\": null,\n\t\"notes\": \"A Difficult Development Area (DDA) for
  the Low Income Housing Tax Credit program is an area designated by the U.S. Department
  of Housing and Urban Development (HUD) with high construction, land, and utility
  costs relative to its Area Median Gross Income (AMGI). All designated DDAs in Metropolitan
  Statistical Areas (MSA) or Primary Metropolitan Statistical Areas (PMSA) may not
  contain more than 20% of the aggregate population of all MSAs/PMSAs, and all designated
  areas not in metropolitan areas may not contain more than 20% of the aggregate population
  of the non-metropolitan counties.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
